export default class SliderHome extends Component {
  render() {

    return (
      <div className="container-slider-serivcos">
        <div className="slider-texto">
            <label>Sejam Bem Vindos: </label>
        </div>
        <div className="slider-imagens-bg">
        </div>
      </div>
    );
  }
}
